function Header() {
  return (
    <header>
      <h1>What's the art?</h1>
      <div class="topnav">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</div>
    </header>
  );
}

export default Header;
